Information
------------------------------
West meets east when actor Dominic West joins his childhood friend Sir James Mallinson on a pilgrimage to northern India and the biggest religious festival in the world, Kumbh Mela. Here, 100 million Hindus have gathered to wash away their sins in the holy rivers near Allahabad, on the banks of Sangam. Jim takes Dom to live with his own sect of holy men, or sadhus, and to witness his ordination as a mahant, a commander of his sect - the first time a westerner has received this honour in this ancient order of master yogis.

